import React, { Component } from 'react';
import LylicBlock from './LylicBlock';

class YoutubeLylic extends Component {
  constructor(props) {
    super(props);

    const array = this.props.array;
    const listItems = array.map((value) => <LylicBlock value={value} />);
    this.state = {
      list: { listItems },
    };
    console.log(listItems);
  }
  render() {
    console.log(this.state.list);
    return <div>{this.listItems}</div>;
  }
}

export default YoutubeLylic;
